import { HomeIndexSection } from './home_section';

const GlowHome = () => {
  const generateEmailAddress = (domnode) => {
    console.log(domnode);
    // let dataset = domnode.dataset;
    // return 'mailto:' + dataset.name + '@' + dataset.domain + '.' + dataset.tld;
  }


  return <div style={{height: 100 + '%', width: 100 + '%'}}>
    <div className='homePageIndicator'>
      <div className='homePageIndicatorBackground' />
    </div>
    <div className='homePageContainer'>
      <HomeIndexSection />
    </div>
    <footer>
      <a href="https://mudev.cc">mudev.cc</a> | MUsoftware (
        <a href="#"
           data-name="musoftware"
           data-domain="mudev"
           data-tld="cc"
           onClick={generateEmailAddress(this)}
          //  onClick="this.href=generateEmailAddress(this)"
        >
          Contect to MUsoftware
        </a> )<br />
    </footer>
  </div>
};

export {
  GlowHome
};
